import React, { Component} from 'react';
import  InputRange  from './InputSlider';

class noValueSlider extends Component {
    constructor(props) {
        super(props);

        this.state = {
            rangeVal: 5,
            rangeVal2: 10,
            rangeVal3: 10,
            rangeVal4: {
                min: 5,
                max: 10,
            },
            rangeVal5: {
                min: 3,
                max: 7,
            },
        }
        this.updateRange = this.updateRange.bind(this);
    }
    updateRange(val) {
        this.setState({
        rangeVal: val
        })
    }    
    render() {
         const { rangeVal } = this.state;
        return (
            <form className="form">                
                <InputRange range={rangeVal} updateRange={this.updateRange} />
                <InputRange range={rangeVal} updateRange={this.updateRange} />
                <InputRange range={rangeVal} updateRange={this.updateRange} />
                <InputRange range={rangeVal} updateRange={this.updateRange} />
                <InputRange range={rangeVal} updateRange={this.updateRange} />
            </form>
        );
    }
}


export default noValueSlider;
